import {Route, Routes, BrowserRouter} from 'react-router-dom'; 
import Landing from './components/Landing/Landing';
import GlobalStyle from "./IndexStyled.jsx";


function App() {
  return (
    <BrowserRouter>
    <GlobalStyle/>
      <Routes>

        <Route path="/" element={<Landing/>}/>

      </Routes>
    </BrowserRouter>

  );
}

export default App;
